INSERT INTO `sys_config` VALUES ('0dab80ed7aa54ebbb343e78fbceb2796','授权安全','授权安全','授权安全','授权安全',30,'0','0,','1','2018-08-23 10:58:40','1','2018-08-23 10:58:40','','0',''),('0e2e40e853ef4935b3055fbd7da9f3fd','skinSetttings','false','主题设置','主题设置',100,'0','0,','1','2018-08-06 14:16:43','1','2018-08-06 14:44:03','','0',''),('20cb1f4466264afb9e7ec7671cc72334','homePageAboveInfomation','true','后台管理首页展示','大众认同、大众参与、成就大众、大众分享的开发平台。\r\nJeeSpring开发平台采用 SpringBoot+Redis+ActiveMQ+SpringMVC + MyBatis + BootStrap + Apache Shiro + Ehcache 开发组件的基础架构.\r\nJeeSpring基于SpringBoot+SpringMVC+Mybatis+Redis+SpringCloud微服务分布式代码生成的敏捷开发系统架构。项目代码简洁,注释丰富,上手容易,还同时集中分布式、微服务,同时包含许多基础模块(用户管理,角色管理,部门管理,字典管理等10个模块。成为大众认同、大众参与、成就大众、大众分享的开发平台。JeeSpring官方qq群(328910546)。代码生成前端界面、底层代码（spring mvc、mybatis、Spring boot、Spring Cloud、微服务的生成）、安全框架、视图框架、服务端验证、任务调度、持久层框架、数据库连接池、缓存框架、日志管理、IM等核心技术。努力用心为大中小型企业打造全方位J2EE企业级平台ORM/Redis/Service仓库开发解决方案。一个RepositoryService仓库就直接实现dubbo、微服务、基础服务器对接接口和实现。\r\n努力用心为大中小型企业打造全方位J2EE企业级平台开发解决方案。\r\nSpring Boot/Spring cloud微服务是利用云平台开发企业应用程序的最新技术，它是小型、轻量和过程驱动的组件。微服务适合设计可扩展、易于维护的应用程序。它可以使开发更容易，还能使资源得到最佳利用。<br>\r\n      <a class=\"btn btn-white btn-bitbucket\" href=\"https://gitee.com/JeeHuangBingGui/jeeSpringCloud\" target=\"_blank\">\r\n                <i class=\"fa fa-cloud\"> </i> 访问码云\r\n            </a>            <a class=\"btn btn-white btn-bitbucket\" href=\"https://gitee.com/JeeHuangBingGui/jeeSpringCloud/attach_files\" target=\"_blank\">\r\n                <i class=\"fa fa-home\"></i> 平台教程\r\n            </a>\r\n      <a class=\"btn btn-white btn-bitbucket\" href=\"http://yocity.imwork.net:10858/admin?login\" target=\"_blank\">\r\n                <i class=\"fa fa-cloud\"> </i> 访问演示版\r\n            </a>\r\n            <a class=\"btn btn-white btn-bitbucket\" href=\"http://www.jeespring.icoc.bz/\" target=\"_blank\">\r\n                <i class=\"fa fa-home\"></i> 访问官网\r\n            </a>\r\n            <a class=\"btn btn-white btn-bitbucket\" href=\"https://jeespring.kf5.com/hc/community/topic/\" target=\"_blank\">\r\n                <i class=\"fa fa-home\"></i> 社区论坛\r\n            </a>\r\n            <a class=\"btn btn-white btn-bitbucket\" href=\"https://jeespring.kf5.com/hc/request/guest/\" target=\"_blank\">\r\n                <i class=\"fa fa-home\"></i> 提交咨询\r\n            </a>\r\n            <a class=\"btn btn-white btn-bitbucket\" href=\"https://jeespring.kf5.com/hc/\" target=\"_blank\">\r\n                <i class=\"fa fa-home\"></i> 帮助\r\n            </a>\r\n<br>\r\n开源版：<br>包含定时任务调度、服务器监控、平台监控、异常邮件监控、服务器Down机邮件监控、平台设置、开发平台、邮件监控、图表监控、地图监控、单点登录、Redis分布式高速缓存、ActiveMQ队列、会员、营销、在线用户、日志、在线人数、访问次数、调用次数、直接集群、接口文档、生成模块、代码实例、安装视频、教程文档、dubbo、springCloud、RedisMQ队列（待开发）、代码生成(增删改查单表、redis高速缓存对接代码)<br>\r\n企业版：<br>包含开源版、代码生成(单表、主附表、树表、列表和表单、增删改查云接口、redis高速缓存对接代码、图表统计、地图统计、vue.js)、工作流（待开发）<br>互联网整合资源：<br>\r\n兑吧积分平台；极光推送；凡科营销和站点；活动汇；现场活动平台；有投票活动平台；云客服平台（客服模块、论坛社区、提交咨询、帮助）；<br>系统配置可开启正式版！功能全开源！每周周一再更新！<br>',1,'b0d87e20d5a04b4d9de12b6458aba41b','0,b0d87e20d5a04b4d9de12b6458aba41b,','1','2018-01-08 16:41:11','1','2018-08-23 14:24:09','','0',''),('38a1a63bd1fe47b5b479bf00385bd38b','IMEnable','false','即时聊天启用/停用','即时聊天启用/停用',100,'0','0,','1','2018-08-06 11:54:47','1','2018-08-07 18:19:01','','0',''),('43733bb06a5f40aca62691352c8fa0f7','homePageAuthorization','true','开源授权','<li>已开源的代码，授权协议采用 AGPL v3 + Apache Licence v2 进行发行。</li>\r\n<li>您可以免费使用、修改和衍生代码，但不允许修改后和衍生的代码做为闭源软件发布。</li>\r\n<li>修改后和衍生的代码必须也按照AGPL协议进行流通，对修改后和衍生的代码必须向社会公开。</li>',100,'b0d87e20d5a04b4d9de12b6458aba41b','0,b0d87e20d5a04b4d9de12b6458aba41b,','1','2018-08-07 12:17:28','1','2018-08-23 10:58:01','','0',''),('573557fbdee74f899ac349f888ce31ee','tabmode','2','页签模式','页签模式',100,'0','0,','1','2018-08-06 12:12:04','1','2018-08-06 14:15:13','','0',''),('5d7ca30afc744c2db6dbae47b45f8c8b','oauthId','123456','接口授权ID','接口授权ID',111,'0dab80ed7aa54ebbb343e78fbceb2796','0,0dab80ed7aa54ebbb343e78fbceb2796,','1','2018-07-27 10:22:30','1','2018-08-23 10:59:24','','0',''),('6ca5a72ab67e42aa922c489a69ccac0d','homePageTechnical','true','JeeSpring 技术特点','<li>使用目前流行的多种web技术，包括spring boot spring mvc、mybatis。</li><li>Spring cloud 分布式、微服务、集群、zookeper、nignx。</li><li>代码生成（前端界面、底层代码、微服务的生成）,根据表生成对应的Entity,Service,Dao,Action,JSP,Redis,APP接口等,。</li><li>RepositoryORM仓库,提供ORM接口和多种实现,可进行配置实现。</li><li>RepositoryRedis仓库,提供Redis接口和多种实现,可进行配置实现。可以配置调用单机、redis、云redis对接。</li><li>RepositoryService仓库,提供Service接口和多种实现,可进行配置实现。可以配置调用dubbo、微服务、基础服务器对接接口和实现。</li><li>查询过滤器，查询功能自动生成，后台动态拼SQL追加查询条件；支持多种匹配方式（全匹配/模糊查询/包含查询/不匹配查询） </li><li>系统日志监控，详细记录操作日志，可支持追查表修改日志</li><li>WebSocket集成：集成在线聊天系统。</li><li>提供常用工具类封装，日志、缓存、验证、字典、组织机构等，常用标签（taglib），获取当前组织机构、字典等数据。</li><li>连接池监视：监视当期系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈。</li><li>支持数据库: Mysql,Oracle数据库的支持，但不限于数据库，平台留有其它数据库支持接口等</li><li>要求JDK1.6+</li>',100,'b0d87e20d5a04b4d9de12b6458aba41b','0,b0d87e20d5a04b4d9de12b6458aba41b,','1','2018-08-07 12:15:58','1','2018-08-23 10:57:48','','0',''),('6e6e0046f96443c98d849221170da226','demoMode','true','演示','演示版启用，系统能正常演示，暂时不允许操作！系统配置可开启正式版！功能全开源！每周周一再更新！',100,'0dab80ed7aa54ebbb343e78fbceb2796','0,0dab80ed7aa54ebbb343e78fbceb2796,','1','2018-08-07 10:25:44','1','2018-08-23 16:27:34','','0',''),('96bcbf91df404802a49797bbf761be2b','oauthOpen','false','授权功能开启停用','oauthOpen接口授权安全认识开启；true为开启，false为关闭',111,'0dab80ed7aa54ebbb343e78fbceb2796','0,0dab80ed7aa54ebbb343e78fbceb2796,','1','2018-07-27 10:21:53','1','2018-08-23 10:59:15','','0',''),('9a9d64ff20124da191cd8c717acfbb07','toExceptionMailAddr','516821420xx@qq.com,870312124xx@qq.com','异常接收邮箱地址','异常接收邮箱地址',111,'0','0,','1','2017-12-11 11:46:25','1','2018-08-20 16:12:04','异常接收邮箱地址','0',''),('9ec8f4851ee947c2a573b2496d4e138b','homePageInfomation','true','首页介绍','<div class=\"col-sm-12\"><div class=\"alert alert-warning\" style=\"width: 90%;\">捐赠榜:<br>  快乐医生^_^捐赠50元;厚德静邦捐赠10元;饮水思源捐赠100元;狼灵捐赠66元;zhengfk捐赠20元;Dobukle捐赠20元;成长!捐赠100元; </div>\r\n\r\n</div><div class=\"col-sm-3\">\r\n        <h2>Hello,Guest</h2>\r\n        <small>移动设备访问请扫描以下二维码：</small>\r\n        <br>\r\n        <br>\r\n 