#
# Structure for table "sys_region_info"
#

CREATE TABLE `sys_region_info` (
  `REGION_CODE` varchar(8) NOT NULL COMMENT '地区编码',
  `REGION_NAME` varchar(128) DEFAULT NULL COMMENT '地区名称',
  `PARENT_CODE` varchar(8) DEFAULT NULL COMMENT '上级编码',
  `ORDER_CODE` int(4) DEFAULT '0' COMMENT '顺序标识',
  `REGION_LEVEL` int(2) DEFAULT NULL COMMENT '层次编码(1省，2市，3县)',
  `STATUS` varchar(8) DEFAULT NULL,
  PRIMARY KEY (`REGION_CODE`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='地区信息';

